import React, { useState } from 'react';

export default function CervixBeslutsstod() {
  const initialState = {
    alder: '',
    hpvTyp: 'negativ',
    persisterandeHPV: 'nej',
    cytologi: 'normal',
    pad: 'ingen',
    swedescore: 'ej utförd',
    vaccination: 'vet ej',
    resultat: ''
  };

  const [state, setState] = useState(initialState);

  const getRekommendation = () => {
    if (state.pad === 'invasiv cancer' || state.cytologi === 'misstanke invasiv cancer')
      return 'Kolposkopi snarast med SVF-remiss för invasiv cancer.';

    if (state.pad === 'AIS' || state.cytologi === 'AIS')
      return 'Kolposkopi snarast med SVF-remiss för AIS.';

    if (state.pad === 'HSIL' || state.cytologi === 'HSIL' || state.cytologi === 'ASC-H') {
      if (state.swedescore === '>7') return 'Behandling rekommenderas (excision/konisering).';
      if (state.swedescore === '<5') return 'Kolposkopisk kontroll snarast, excision om osäkerhet.';
      if (state.swedescore === 'ofullständig') return 'Ny kolposkopi snarast.';
      return 'Kolposkopi snarast för bedömning.';
    }

    if (state.pad === 'LSIL' || ['ASCUS', 'LSIL'].includes(state.cytologi))
      return 'Kolposkopisk kontroll inom 3–6 månader.';

    if (state.persisterandeHPV !== 'nej')
      return 'Kolposkopi bör utföras inom 3 månader oavsett cytologiskt svar.';

    if (state.hpvTyp === 'negativ' && state.cytologi === 'normal')
      return 'Åter till ordinarie screening enligt ålder (5–7 år).';

    if (state.hpvTyp === 'högonkogena' && state.cytologi === 'normal')
      return 'Ny kontroll med HPV och cytologi om 18 månader.';

    if (state.hpvTyp === 'medelonkogena' && state.cytologi === 'normal')
      return 'Ny kontroll med HPV och cytologi om 24 månader.';

    if (state.hpvTyp === 'lågonkogena' && state.cytologi === 'normal')
      return 'Ny kontroll med HPV och cytologi om 36 månader.';

    return 'Ej definierad kombination – diskutera med kolposkopist.';
  };

  const resetState = () => setState(initialState);

  return (
    <div className="max-w-md mx-auto mt-10 p-6 bg-white rounded-xl shadow-lg">
      <h2 className="text-2xl font-bold mb-6 text-center">Cervixcancer beslutsstöd</h2>

      {[
        { label: 'Ålder:', type: 'number', key: 'alder' },
        { label: 'HPV-status:', type: 'select', key: 'hpvTyp', options: [
          'Negativ', 'Högonkogena HPV (16, 18, 45)', 'Medelonkogena HPV (31, 33, 52, 58)', 'Lågonkogena HPV (35, 39, 51, 56, 59, 66, 68)'
        ] },
        { label: 'Persisterande HPV-infektion:', type: 'select', key: 'persisterandeHPV', options: [
          'Nej', 'Högonkogen >12 mån', 'Medelonkogen >30 mån', 'Lågonkogen >54 mån'
        ] },
        { label: 'Cytologisk diagnos:', type: 'select', key: 'cytologi', options: [
          'Normal', 'ASCUS', 'LSIL', 'ASC-H', 'HSIL', 'AGC', 'AIS', 'Misstanke invasiv cancer'
        ] },
        { label: 'PAD-svar:', type: 'select', key: 'pad', options: [
          'Ingen PAD utförd', 'LSIL', 'HSIL', 'AIS', 'Invasiv cancer'
        ] },
        { label: 'Swedescore:', type: 'select', key: 'swedescore', options: [
          'Kolposkopi ej utförd', 'Ofullständig kolposkopi', 'Swedescore <5', 'Swedescore >7'
        ] },
        { label: 'Tidigare HPV-vaccination:', type: 'select', key: 'vaccination', options: [
          'Vet ej', 'Ej vaccinerad', 'Vaccinerad med Gardasil', 'Vaccinerad med Gardasil-9'
        ] }
      ].map((field, index) => (
        <label key={index} className="block mb-4">
          <span className="block font-semibold mb-1">{field.label}</span>
          {field.type === 'number' ? (
            <input type="number" className="border p-2 w-full rounded" value={state[field.key]} onChange={(e) => setState({...state, [field.key]: e.target.value})} />
          ) : (
            <select className="border p-2 w-full rounded" value={state[field.key]} onChange={(e) => setState({...state, [field.key]: e.target.value})}>
              {field.options.map((opt, i) => (
                <option key={i} value={opt.toLowerCase()}>{opt}</option>
              ))}
            </select>
          )}
        </label>
      ))}

      <button className="w-full bg-blue-600 hover:bg-blue-700 text-white py-2 px-4 rounded mb-2" onClick={() => setState({...state, resultat: getRekommendation()})}>
        Visa rekommendation
      </button>

      <button className="w-full bg-gray-400 hover:bg-gray-500 text-white py-2 px-4 rounded" onClick={resetState}>
        Nollställ
      </button>

      {state.resultat && (
        <div className="mt-6 p-4 bg-green-100 rounded border border-green-400">
          <strong>Rekommendation:</strong>
          <p>{state.resultat}</p>
        </div>
      )}
    </div>
  );
}
